import React from 'react';

import BulletDescription from './BulletDescription';
import circle from '../images/circle.png';

const ExperienceLeft = props => {
  return (
    <div className="experience-indi">
      <div className="left">
        <div className="left-container">
          <h3>{props.year}</h3>
          <h4>&nbsp;{props.months}</h4>
        </div>
        <div className="timeline">
          <img
            className="circle"
            src={circle}
            alt="timeline"
            height="20px"
            width="20px"
          />
        </div>
      </div>
    </div>
  );
};

export default ExperienceLeft;
